  \"2015-11-27T21:16:45.137311\",\n\t\"name\": \"national-hydrography-dataset-nhd-high-resolution-minnesota\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The National Hydrography Dataset (NHD)
  is the surface-water component of The National Map. The NHD is a comprehensive set
  of digital spatial data that represents the surface water of the United States using
  common features such as lakes, ponds, streams, rivers, canals, stream gages, and
  dams. Polygons are used to represent area features such as lakes, ponds, and rivers;
  lines are used to represent linear features such as streams and smaller rivers;
  and points are used to represent point features such as stream gages and dams. Lines
  also are used to show the water flow through area features such as the flow of water
  through a lake. The combination of lines is used to create a network of water and
  transported material flow to allow users of the data to trace movement in downstream
  and upstream directions. The Watershed Boundary Dataset (WBD) is a companion dataset
  to the NHD. It defines the perimeter of drainage areas formed by the terrain and
  other landscape characteristics. The drainage areas are nested within each other
  so that a large drainage area, such as the Upper Mississippi River, will be composed
  of multiple smaller drainage areas, such as the Minnesota River. Each of these smaller
  areas can further be subdivided into smaller and smaller drainage areas. The WBD
  uses six different levels in this hierarchy, with the smallest averaging about 30,000
  acres. The WBD is made up of polygons nested into six levels of data respectively
  defined by Regions, Subregions, Basins, Subbasins, Watersheds, and Subwatersheds.\",\n\t\"license_title\":
